
# 914

from typing import List


class Solution:

	def hasGroupsSizeX(self, deck: List[int]) -> bool:

		result = {}

		if deck:
			# the setting up of a dictionary with the cards and their counts
			for card in deck:
				if card in result:
					i = result[card]
					result.update({card: i+1})
				else:
					result[card] = 1
		else:
			return False

		# calculation of the smallest divisor
		old_entry = min(result.values())
		for entry in result.values():
			nwd_value = nwd_i(old_entry, entry)
			if nwd_value < old_entry:
				old_entry = nwd_value

		if old_entry >= 2:
			for entry in result.values():
				if entry >= old_entry and entry % old_entry != 0 or entry < old_entry and old_entry % entry != 0:
					return False
			return True
		else:
			return False


def nwd_i(val1: int, val2: int):
	while val2:
		val1, val2 = val2, val1 % val2
	return val1


